import React, { Link, Button } from "react"

class Header extends React.Component {
    render() {
        return (
            <>
                <ul>
                    <li><Link to="Home">Home</Link></li>
                </ul>
                <Button>+ Submit</Button>
            </>
        )
    }
}

export default Header;
